function onClick_subtree(n){let u=document.getElementById(n).parentElement,t=n.match(/(?!.*\|)(.+)/)[0];console.log(t);let i=document.getElementById(n),r=i.getElementsByClassName("feat-open")[0];load(r);$.ajax({url:"/FeatTree/GetChildren",method:"GET",data:{parent:t},accepts:"application/json",success:function(t){console.log(t);hideOtherFeats();createSubTree(u,n,t);i.removeChild(r)}})}function hideOtherFeats(){}function load(n){n.classList.remove("glyphicon");n.classList.remove("glyphicon-chevron-down");n.classList.add("loader")}function doneLoading(n){n.classList.remove("loader");n.classList.add("glyphicon");n.classList.add("glyphicon-chevron-down")}function createSubTree(n,t,r){let u=document.createElement("div");for(u.classList.add("col-md-12"),i=0;i<r.length;i++){let s=r[i],f=document.createElement("div");f.classList.add("row");f.classList.add("feat-tree-area");let n=document.createElement("div");n.classList.add("col-md-3");n.classList.add("feat-tree-block");n.id=t+"|"+s.name;n.onclick=function(){onClick_subtree(n.id)};let h=document.createElement("span");h.classList.add("link-img");let e=document.createElement("a");e.href=s.link;e.target="_blank";let c=document.createElement("img");c.src="/images/link.png";e.appendChild(c);h.appendChild(e);let l=document.createElement("strong"),a=document.createTextNode(s.name);l.appendChild(a);let o=document.createElement("span");o.classList.add("glyphicon");o.classList.add("glyphicon-chevron-down");o.classList.add("feat-open");n.appendChild(h);n.appendChild(l);n.appendChild(o);f.appendChild(n);u.appendChild(f)}n.appendChild(u)}